import React, { Component } from "react";
import {
MDBNavbar, MDBNavbarBrand, MDBNavbarNav, MDBNavItem, MDBNavLink, MDBNavbarToggler, MDBCollapse, MDBFormInline,
MDBDropdown, MDBDropdownToggle, MDBDropdownMenu, MDBDropdownItem, MDBCardImage, MDBView,MDBCol,MDBCardTitle
} from "mdbreact";
import { BrowserRouter as Router } from 'react-router-dom';
import About from './about';
import { BrowserRouter, Route, Link } from 'react-router-dom';


class NavbarPage extends Component {
state = {
  isOpen: false
};

toggleCollapse = () => {
  this.setState({ isOpen: !this.state.isOpen });
}

render() {
  return (
    <Router>
      <MDBNavbar color="black" dark expand="md">

      <MDBCol md="1">
            <MDBView hover zoom>
              <img position="left"
                src="https://mdbootstrap.com/img/Others/documentation/img%20(131)-mini.jpg"
                className="img-fluid"
                alt=""
              />
              {/* <MDBMask className="flex-center">
                <p className="white-text"></p>
              </MDBMask> */}
            </MDBView>
          </MDBCol>
        <MDBNavbarToggler onClick={this.toggleCollapse} />
        <MDBCollapse id="navbarCollapse3" isOpen={this.state.isOpen} navbar>
          <MDBNavbarNav left>

            <MDBNavItem>
            <MDBCardTitle  id="p1"><marque><h1>Welcome to peyload</h1></marque></MDBCardTitle>
            </MDBNavItem>
          </MDBNavbarNav>

          <MDBNavbarNav right>
          <MDBNavItem active>
              <MDBNavLink to="/"><h3><strong>Home</strong></h3></MDBNavLink>
              <Route path="/home" component={Home} />
            </MDBNavItem><br></br>
            <MDBNavItem>
              <MDBNavLink to="/About"><h3><strong>About</strong></h3></MDBNavLink>
              <Route path="/about" component={About} />
            </MDBNavItem>
            <MDBNavItem>
              <MDBNavLink to="#!"></MDBNavLink>
            </MDBNavItem>
          </MDBNavbarNav>
        </MDBCollapse>
      </MDBNavbar>
    </Router>
    );
  }
}

export default NavbarPage;
